import './App.css';
import { HashRouter } from "react-router-dom";
import {Routes, Route, Navigate} from "react-router";


function App() {
  return (
    <HashRouter>
      <Routes>
      <Route path="/Labs/*"   element={<Labs/>}/>
          <Route path="/Kanbas/*" element={<Kanbas/>}/>
          <Route path="/hello"    element={<HelloWorld/>}/>
      </Routes>
      <div className="App">
        Losers web
      </div>
    </HashRouter>

  );
}

export default App;
